INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(6, '婚内安全感测试', '你会羡慕身边结了婚的朋友很和睦幸福的样子吗', '/profile/upload/2023/02/08/01_20230208194042A008.png', '/profile/upload/2023/02/08/02 (1)_20230208194720A010.jpeg', '/profile/upload/2023/02/09/99999999999999999_20230209153750A040.jpeg', 4, 10, '有很多人觉得单身的日子孤独寂寞，看到身边结了婚的朋友很和睦幸福的样子，就会很羡慕，寄希望于婚姻，希望婚姻能够帮助自己赶走孤独寂寞的滋味，能够带给自己足够的安全感。婚姻是一份爱和责任，能够带给每个人的感受不同，至于安全感，当然也是不一样的', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(11, '家庭教养方式测评问卷', '家庭教养方式测评问卷', '/profile/upload/2023/02/08/03 (1)_20230208202005A012.png', '/profile/upload/2023/02/08/03 (2)_20230208202141A013.png', NULL, 4, 13, '此量表主要在于测量您对孩子的教养方式为哪一种类型。请根据量表的描述，结合现实生活中您跟孩子的相处方式，判断该描述跟您的实际情况是否符合，在“总是如此”、“多数如此”、“有时如此”、“从未如此”四个选项中选择最为合适的一个。', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(12, '亲子关系问卷量表', '亲子关系问卷量表', '/profile/upload/2023/02/08/04 (1)_20230208205253A015.png', '/profile/upload/2023/02/08/05 (1)_20230208205731A016.png', NULL, 4, 20, '该量表主要在于测量您和孩子的关系如何。家长您好：请根据你的实际情况（实际感受）作答。答案没有对错之分，对每一个句子无须多考虑。		', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(13, '安全感测试：你有多缺爱？', '安全感测试：你有多缺爱？', '/profile/upload/2023/02/08/06_20230208214736A019.jpeg', '/profile/upload/2023/02/08/05_20230208213158A018.jpeg', NULL, 1, 16, '一个人缺乏安全感，心理成长就会停滞，而有安全感的人会追求更高层次的需要，容易达到自我实现。此安全感测试依据马斯洛的安全—不安全量表（S—I）编制。请阅读每一条陈述，判断与你经常性的感受或行为相符合的程度，不必对任何一条花太多的时间去考虑。', 19.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(14, '八道题测试你的心理素质', '八道题测试你的心理素质', '/profile/upload/2023/02/08/09_20230208222410A024.jpeg', '/profile/upload/2023/02/08/07_20230208214958A020.jpeg', NULL, 1, 8, '做完以下八道心理素质测试题，就能大致了解你的心理素质和应付能力。', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(15, '测一测你的人际魅力指数', '测一测你的人际魅力指数', '/profile/upload/2023/02/08/12_20230208223810A027.jpeg', '/profile/upload/2023/02/08/11_20230208222928A026.jpeg', NULL, 1, 25, '一个人的魅力与其情感能力与社交能力有很大的关系。很多人都认为魅力是上天给一小部分幸运的人的特殊馈赠。然而，关于魅力的调查研究表明，一个人的魅力是可以被测量的，且有一些基本因素是，这些因素被统称为“魅力商数”。想知道你在与人交往时能够展现出自己的多少魅力吗？测测看吧！', 69.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(16, '测一测你性格里最真实的一面', '测一测你性格里最真实的一面', '/profile/upload/2023/02/08/18_20230208231329A029.jpeg', '/profile/upload/2023/02/08/14_20230208225519A028.jpeg', NULL, 1, 13, '面具下的个人才最真实。社会心理学家笑侃每个人的家里都置有一个面具衣柜，以扮演不同的角色，应对不同的需要和责任。所以，当你摘下所有的面具，你的性格呈现哪种特质呢？本题告诉你答案。		', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(17, '核心自我评价测试', '核心自我评价量表', '/profile/upload/2023/02/09/00001_20230209114150A032.png', '/profile/upload/2023/02/09/000_20230209112701A031.png', NULL, 1, 10, '核心自我评价量表包含了4种核心人格特质的测量：自尊、控制点、神经质和一般自我效能。该量表由Judge等编制 ，国内进行了翻译和修订，使其更符合中国的文化背景。		', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(18, '自我价值评估', '测测你的自我价值', '/profile/upload/2023/02/09/555_20230209131527A037.jpeg', '/profile/upload/2023/02/09/44_20230209130732A036.jpeg', NULL, 1, 10, '自我价值感是个体存在的价值和意义，它反应着一个人的自信度水平。		', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(19, '你对另一半满意吗？', '你对另一半满意吗？', '/profile/upload/2023/02/09/3333333_20230209125314A033.jpeg', '/profile/upload/2023/02/09/3333333_20230209125429A034.png', NULL, 1, 10, '该问卷是了解您的婚姻状态的，虽然它不能预测您的婚姻是否成功，但可以发现婚姻中可能存在和需要解决的问题，有助于得到专家的指导。希望您如实填写，不要征求他人的意见，独立完成。请注意：条目中的“我们”是指您和您的伴侣。对每一个条目均进行5级评定，具体如下：1.确实是这样；2.可能是这样；3.不同意也不反对；4.可能不是这样；5.确实不是这样		', 9.90, NULL, 1, 'admin', NULL, 'admin', NULL, NULL);
INSERT INTO psy_gauge (id, title, subtitle, head_picture, list_show_picture, introduce, gauge_class, gauge_num, gauge_des, price, num, `type`, create_by, create_time, update_by, update_time, remark) VALUES(20, '你拖延到什么程度了?', '你拖延到什么程度了?', NULL, NULL, NULL, 1, 15, '哪里有尴尬和不舒服，哪里就潜伏着拖延的可能性。战胜拖延的第一步就是了解自己的拖延现状，还等什么，赶快开始自我评估吧！		', 9.90, NULL, 1, 'admin', NULL, '', NULL, NULL);
