INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(18, 6, 31, 40, '', '【安全感指数：10%】你本身来说，就是一个很没有安全感的人。 你总是担心自己做的不够好，可以说你所有的努力都是为了得到别人的肯定去做的，而不是为了好好爱自己。 婚姻对你来说，更像是一项要完成的人生大事，像一个任务，而不是因为爱所以爱的结果。 你一心希望婚姻能消除你的孤独，带给你安全感，可是你的内心充满了不安，婚后的琐事只会令你更不安的。 一个人不能过好，两个人也一样不能过好，安全感应该是自己给的。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(19, 6, 25, 30, '', '【安全感指数：40%】你是一个很感性的人，考虑的问题太多，旁人有意无意说的话对你的影响也是很明显的，所以你面对生活中的很多事都不是很坚定，常常都是犹豫着好不容易做出选择以后，又后悔自己的决定。 徘徊着，纠结着都可以说已经是你的一种习惯了。 你对这个世界有很多的不安，就算结了婚，也一样会不安，特别是看到有人离婚，心里的不安就会成倍的放大了。 未来本就是不可预见的，珍惜拥有的，一个有安全感的婚姻是爱自己的副产品。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(20, 6, 20, 24, '/profile/upload/2022/10/11/测评说明_20221011152529A002.png', '【安全感指数：60%】你虽然在遇到不顺时，也会不满，也会有所抱怨，但是你懂得适可而止。 你会积极主动的消化吸收那些正能量，也能领悟到安全感是来自内心的道理。 你对婚姻有很美好的期望，但是你不会把安全感完全寄希望于婚姻上。 虽然你做的还不是太好，但是你至少会学着好好爱自己，在你爱自己的基础上，婚姻才能带给你更多的欢乐。 一个人只有爱自己，才有理由爱上自己选择的婚姻，才能把婚姻经营好，安全感一直都在心里。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(21, 6, 10, 19, '', '【安全感指数：95%】你是一个会理性认识世界，认识生活，认识和保护自己的人。 你在爱别人之前，你首先是很爱自己的，你会理性的看待婚姻。 在你没有进入到婚姻的角色之前，你就已经是一个很有安全感的人了。 你懂得选择自己喜欢的生活，与志同道合的人交朋友，你也知道适合自己的对象是什么样的，会选择自己所爱，更会爱自己所选择的。 你爱自己，爱你的人就会更爱你，你爱你的婚姻，你的婚姻就会给你加倍的安全感的。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(38, 11, 13, 25, '', '您的教养方式为溺爱型。您一般很少给孩子设限制或者说根本不设限制,只要在保持身体安全的条件下会尽可能给予孩子自由。您有时会容许孩子做出一些令您生气的行为，但您不知道该如何表达自己的愤怒，往往以“我很忙、我不懂”来放弃教育孩子的责任。结果，当怒气积累到不可控制的程度，您往往会痛斥孩子，更有可能出其所愿地伤害孩子。您看似整天围着孩子转，和孩子的关系融洽，实则是看着孩子的脸色唯唯诺诺,孩子是“小皇帝”，是家庭里的“中心”。 专业建议：给予孩子一定的自由空间是必须的，但同时要懂得给孩子设置必要的限制。在孩子成长的过程中，家长有着指导、提供标准的责任，必要的限制不会阻碍孩子的成长，反而能够促进孩子在一个正确的方向上更好的发展。所以，您最迫切的任务在于放弃对孩子无条件的服从，开始教育孩子严格遵守一定的规则制度。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(39, 12, 20, 59, '', '亲子关系已有了危机，须马上调整。 建议：您需要缓和与孩子之间的关系，可以尝试与孩子多聊聊学校里的生活，每天有哪些开心和不开心的事情，试着去倾听孩子的声音，像对待朋友般给出建议而不是严厉地去指责孩子。平常的时候可以尝试与孩子一同参与一些户外活动，增进彼此间的联系。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(48, 11, 26, 38, '', '您的教养方式为权威型。您在给孩子发展自立能力的同时，也为孩子的成长提供了所需的标准、必要的限制和指导性原则。您关心孩子，对孩子的需要能作出敏感的反应,您和孩子的关系应该较为亲密，情感和思想的交流都很充分,您的孩子应该有较强的自我控制能力，社会适应都良好。 专业建议：您目前的教养方式对孩子的发展是较为合适的，请继续保持。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(49, 12, 60, 79, '', '你们的相处还算良好。 建议：您和孩子相处的较好，继续保持这样的状况，尝试进一步地去与孩子沟通内心的想法和观念，您和孩子的关系可以更进一步。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(50, 11, 39, 52, '', '您的教养方式为专制型。您会要求孩子绝对听从自己的意见，服从自己的决定，为孩子设计将来的发展方向，您与孩子的关系是不平等的，日常难以进行有效的沟通。您与孩子关系可能不太融洽，甚至可能类似“猫和老鼠”的关系,您的孩子可能形成言语上和行为上的两面性，同时相较其他孩子可能缺乏自信。 专业建议：给孩子设定标准和规则是需要的，但同时您需要学会尊重孩子的主观能动性，您可以尝试平等地对待孩子，给孩子一定的空间自己去探索，选择，也许有时候孩子会犯错，但这正是孩子成长的途径，相比较您直接告诉他什么能做，什么不能做，效果会好很多。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(51, 12, 80, 100, '', '恭喜你，你们的亲子关系很好 建议：您和孩子相处的非常好，请继续保持下去。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(52, 13, 1, 20, '', NULL);
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(53, 14, 0, 24, '', '你承受压力的心理素质比较差，很容易失去心理平衡，变得窘促不安，甚至惊慌失措。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(54, 14, 25, 31, '', '你的心理素质比较强，性情还算比较稳定，遇事一般不会十分惊慌，但有时往往采取消极应付的态度。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(55, 14, 32, 40, '', '你的心理素质很好，几乎没有令你感到尴尬的事，尽管偶尔会失去控制，但惫自来说，你的应变能力很强，是一个能经常保持镇静，从容不迫的人。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(56, 15, 25, 30, '', '【魅力指数：60分】想要在与人交往的过程中展现自己的魅力，主要受到两大因素的制约：情感能力和社会交往能力。而这两大能力又分为三个水平：表达水平、感受水平和控制水平。根据你的得分来看，你在这两大能力的得分上都比较低，即使你有着较为不错的先天条件（比如外貌、身材等等），但由于你没有发展出足够的魅商，因此你始终不能很好地展现出自己的魅力。 说准你了吗？ 不如分享给朋友看看他们是什么样的吧！');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(57, 15, 31, 50, '', '【魅力指数：70分】想要在与人交往的过程中展现自己的魅力，主要受到两大因素的制约：情感能力和社会交往能力。而这两大能力又分为三个水平：表达水平、感受水平和控制水平。根据你的得分来看，你可能在某一能力方面存在着较大的不足，或者是在两种能力中都得分较低。情感能力能够让你表达出适合的情感以及更好地理解他人的情感，而社会交往能力则能够让你在社交场合更加应对自如，只有掌握好这两大能力，你才能够真正展现出自己的魅力。 说准你了吗？ 不如分享给朋友看看他们是什么样的吧！');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(58, 15, 51, 90, '', '【魅力指数：80分】想要在与人交往的过程中展现自己的魅力，主要受到两大因素的制约：情感能力和社会交往能力。而这两大能力又分为三个水平：表达水平、感受水平和控制水平。根据你的得分来看，你在这两方面表现得都比较不错，更有可能有一方面的能力是你尤为擅长的。当然，这并不是说你已经能够完全将自己的魅力展现出来了，你只有让自己的社交和情感能力更加精进，才能够在他人面前展示出更大的魅力。 说准你了吗？ 不如分享给朋友看看他们是什么样的吧！');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(59, 15, 91, 100, '', '【魅力指数：90分】想要在与人交往的过程中展现自己的魅力，主要受到两大因素的制约：情感能力和社会交往能力。而这两大能力又分为三个水平：表达水平、感受水平和控制水平。根据你的得分来看，你在两方面的能力上都有着十分出色的表现，你擅长理解他人的情感，并在各种场合下都能表现出符合该场合氛围的情绪；同时你在社交场合中，知晓并且遵守着社交礼仪，同时也能够很快拉近与他人的距离。你的魅商很高，能够完全展现出自己的魅力，给他人留下一个深刻的印象。 说准你了吗？ 不如分享给朋友看看他们是什么样的吧！');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(60, 16, 101, 195, '', '【积极热情】个性开放，觉得助人为快乐之本。做事乾脆俐落，有时会过度激动，但又富有强烈的同情心，令人莫明的想和他们亲近。也因为他们的复原力很强，我们能轻易感觉一股够劲的行动力，和他们在一起就像有了一股生命的泉源，不会有想放弃的念头，因为他们总是抱持著乐观进取的态度。 ◎积极人：勇於追求目标理想，不会放弃任何希望，也具有越挫越勇的特质和困难环境中越不易击败的精神。 ◎热情人：生活圈广泛五彩缤纷，比较不拘小节，因此造成他们的个性坦率直来直往活泼好动的性格，也常有孩子气的举动。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(61, 16, 90, 100, '', '【领导人】做事慢条斯理，喜欢思考、沉淀思绪，爱好命令别人，讨厌别人的反抗与被质疑的态度，不容许也不容许自己输给别人。喜爱学习，想让自己成为最好的。而达不到目标时，会不分青红皂白的生闷气。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(62, 16, 79, 89, '', '【感性人】表达能力丰富，想像空间大，因此常胡思乱想而变的多愁善感，容易沉醉在罗曼蒂克与甜言蜜语渔，对爱情总是既期待又怕受伤，常无厘头又莫明的对号入坐。个性属於优柔寡断型，通不顾现实只跟著感觉走，让人猜不著他的想法与思考逻辑。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(63, 16, 60, 78, '', '【理性＆淡定】做事总是深思熟虑考虑再三，谨慎小心，冷静且也当个容易妥协的人，有时候宁愿自己承受舆论与压力，也不愿说出来和好友谈谈，因为他们总是认为自己能熬过那么不堪苦的日子，痕都只是在逞强罢了。他们通常讨厌被束缚，更市酷爱自由！ ◎理性人：深思熟虑为第一原则，凡事要求公私分明，生活可能较拘谨严肃，对於赞美悲伤或开心等没什么差异性。 ◎淡定人：与世无争恬定主意者，内心没什么波澜，就像温驯的绵羊，只要能够生活就好，不必计较太多，成为只羡鸳鸯不羡仙的那一类人。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(64, 16, 40, 59, '', '【双重＆孤寂】环境的因素会让你不知道该怎么表现你自己，所以你可能有见人说人话的习惯，其实你热爱人多的时候，只是有时会导致你慌乱，不过你还会因为现实的需要而委屈自己，配合他人！通常会得不到满足而受挫，造成自闭。 ◎双重人：不会适时表达情感，压抑情绪总是他们碰到阻碍和困难时的第一个反应，学习如何发泄情绪与传达自己的意见，市必须优先学习的。 ◎孤寂人：对於现实不满，不易与人相处，难以找到生活的目标与重心，觉得没人了解自己，常引发强烈的自我防卫意识，就算与人交往，心中仍有一份挥之不去的孤单。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(65, 16, 0, 39, '', '【现实＆自我】喜欢多变刺激的事，是个很有心机的人，而且计划周详，别人对你难以揣测，对任何事你都充满企图心，刚愎自用，想突显求表现。常追求遥不可及的梦想，造成不平衡的心态，隐瞒自己也欺骗别人。 ◎现实人：为了讨好上司、朋友，让人觉得墙头草两边倒，心机重，心眼小，自私又自利，但往往能为自己打算未来，为自己创造一番天地。 ◎自我人：常透过主观的感受来表达意见，然而，人际关系的走样，或许是造成压力的来源。不自觉的划地自限压抑情绪，也不愿被外在所影响而尝试改变，更不会考虑别人的感受，即便经历了挫折？仍然固执自己的理念。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(66, 17, 10, 20, '', '您对核心自我的评价很低，核心自我评价很低会让您在面对事业（学习）时难以获得成功的激励，而对挫折的沮丧会加成，建议您进行一段专业的心理咨询去认识真实的自我。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(67, 17, 20, 30, '', '您对核心自我的评价较低，核心自我较低并不能让您对自我形成一个准确的认识，较低的核心自我会阻挡您对于某些机遇的把握，建议你可以通过心理咨询来认识真实的自我。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(68, 17, 31, 40, '', '您对核心自我的评价较高，核心自我评价较高让您对大多数事情都充满了自信，这是成功的起步，也是魅力的一种，请继续保持。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(69, 17, 41, 50, '', '您对核心自我的评价很高，核心自我评价很高的您一定是一个非常自信的人吧，现实的生活中是否会给人一种太过强势的感觉呢？正所谓有利则有弊，很高的核心自我评价能够帮助能自信得走在自己认定的道路上，但有时候您也需要听听周围的声音。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(70, 18, 0, 6, '', '【低自我价值感】对自己缺乏自信，不会主动为自己争取机会，对自己的尊重程度欠缺，也可能会感受到别人对自己也不够尊重，平时比较容易焦虑，情绪容易低落，自我价值感迫切需要提升。 你首先需要认识到，自己在自我认识上存在偏颇，生命原本就是有价值的，你本来就是有价值的，很重要的。你需要在自我欣赏、自我关爱和自我肯定方面继续提高，并带着勇气去尝试和实践，在实践中肯定自己的进步。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(71, 18, 7, 8, '', '【中等程度的自我价值】对自己有些自信，但在某些方面仍然信心不足，在自我尊重和赢得他人尊重方面仍有些欠缺，可以在带着勇气的实践和尝试中，继续强化自我肯定、自我关爱和自我尊重。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(72, 18, 9, 10, '', '【高自我价值】你对自己是充满信心的，你会主动为自己争取机会，而且你的运气似乎总是不错，你会尊重自己，也会因此赢得别人的尊重。你也懂得关爱自己，相信自己，相信自己的直觉和选择。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(74, 19, 0, 36, '', '您的对伴侣关系满意度很低，已经低于正常范围，您需要寻求专家的帮助，你们的关系中存在较大隐患，长期看，你们的关系出现裂痕的可能性很大。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(75, 19, 37, 43, '', '您对和伴侣的关系基本是满意的，希望您继续保持，您也可以寻求专家的建议，让您和伴侣的关系得到更好的改善。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(76, 19, 44, 50, '', '您对和伴侣的关系是满意的，暂时无需情感专家的帮助。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(77, 20, 0, 4, '', '你有【轻微的拖延倾向】，你所完成的工作常常都不是很完美，因为你没有给自己充足的时间去好好雕琢细节。你会有轻微的拖延倾向，但这并没有影响你的整体工作效率。好好思考自己在哪个环节上易产生拖延，然后在这方面努力做出一些改变吧！');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(78, 20, 5, 11, '', '你有【中度拖延倾向】，我知道你不喜欢自己拖延，但你离重度拖延不远啦！你总是心急火燎地赶工，在最后一刻完成任务。当回头看自己的一天甚至过去的一周时，你都会很惊奇感慨：“这些时间都去哪儿了？我都干了些什么？”你可以通过对任务进行优先级管理来帮助自己摆脱拖延，并思考思考到底什么才是你生命最重要的。');
INSERT INTO psy_gauge_score_setting (id, gauge_id, `start`, `end`, proposal, `result`) VALUES(79, 20, 12, 15, '', '你有【重度拖延倾向】，你习惯于把重要的工作和一些毫不相关的小事混在一起。你经常拖延工作甚至根本就无视工作。你把大把时间浪费在了制定计划和目标、做白日梦上面。或许你需要一个时间管理教练，或自己开始学习时间管理。时间管理能教你设定可达成的目标，并且找到终结拖延习惯的积极途径，你一定会从中受益！');
